(81, NULL, 'Photon-09', 78, 'Avinash Kumar', 'Azure Data Architect', 2, '1', 'Photon infotech', '55k', '60k', 'Hourly', '2019-09-26', 'Published', 'no', 'United States', '2019-09-30', NULL, 'BA,PhD,B.Tech,M.Tech', '8+', '8+', '8+', 'Chicago', 'IL', 'Contract', '9+', 'Month', '3', 'Position: Azure Data Architect \r\nLocation: Chicago, IL\r\nDuration: Contract (Long Term)\r\n            \r\nJob Description:\r\nThe  Architect will own the Azure Data Services technical architecture: data architecture design sessions, implementation and/or Proofs of Concepts. The ideal candidate will have experience in customer facing roles and success leading deep technical architecture and design discussions with senior executives.\r\n\r\nKey Responsibilities\r\n\r\n•	Interface with delivery team to design Azure data services solutions in support of the overarching analytics services solution, including SQL Database,  SQL Data Warehouse, HD Insight, AZURE EVENT HUB, AZURE DATA FACTORY, AZURE DATA LAKE, Stream Analytics, and Notification Hubs\r\n•	Architect scalable data processing and analytics solutions, including technical feasibility for Big Data storage, processing and consumption e.g., development of enterprise Data Lake strategy, heterogeneous data management, Polyglot Persistence, decision support over Data Lake\r\n•	Report on progress of PROGRAM objectives; Ensure plan execution, Document and share technical best practices / insights with Engineering team\r\n\r\nExperience Required\r\n\r\n•	5+ years of experience with deep understanding in both traditional and modern data architecture and processing concepts, including relational databases (e.g., SQL Server, MySQL, Oracle), Data warehousing, big data (Hadoop, Spark, Storm), noSQL, and business analytics\r\n•	5+ years of success in consultative/complex technical deployment projects (where necessary, managing various stakeholder relationships to get consensus on solutions)\r\n•	Understanding of big data use-cases and Hadoop-based design patterns Knowledge of real time/stream analytics trends\r\n•	5+ years of architecture, design, implementation, and/or support of complex application architectures (i.e. having an architectural sense for connecting data sources, data visualization, structured and unstructured data, etc.)\r\n•	Demonstrable hands on experience implementing Big Data solutions using Microsoft Data Platform and Azure Data Services\r\n•	Create a data factory, orchestrate data processing activities in a data-driven workflow, monitor and manage the data factory, move, transform and analyze data\r\n\r\no Design big data real-time processing solutions:\r\nIngest data for real-time processing, design and provision compute resources, design for lambda architecture, design for real-time processing\r\n\r\no Designing big data batch processing and interactive solutions:\r\nIngest data for batch and interactive processing, design and provision compute clusters, design for data security, design for batch processing, design interactive queries \r\n\r\nDeep technical experience in one or more of the following areas: Software design or development, Application Design, Systems Operations / Management, Database architecture, Virtualization,IT Security\r\n\r\nWorking knowledge with AGILE development, SCRUM and Application Lifecycle Management\r\n\r\n\r\nTechnical Requirements\r\n\r\n•	Proficient with Azure cloud computing \r\n•	Azure SQL DB/DW, HD Insight, Azure Data Lake Storage, Azure Data Lake Analytics, Stream Analytics, Azure Data Factory, and CosmosDB.\r\n•	Experience of hybrid and/or cloud architectures that utilize Azure\r\n•	Experience in or exposure to solutions that are analytical in nature, employing data centric architectures\r\n•	Data technology literate with a detailed understanding of data architecture and data tools and technologies, in particular in memory/in database and open source technology.\r\n•	Familiarity and experience with Java/Node based Microservices\r\n\r\n\r\nKnowledge and/or experience in one of the below listed bullets:\r\n•	C#, R, Python, SQL, PL/SQL, MDX, JSON, XML, .NET, C++, T-SQL, Java, JSON, PHP\r\n•	Hadoop, Spark, Storm, Pig/Hive\r\n•	NoSQL,  MongoDB\r\n•	PL/SQL Developer, SQL Query Analyzer,  PowerBI, Visual Studio, TFS\r\n•	Voltage Decryption\r\n\r\nCERTIFICATION (preferred) \r\n•	Microsoft Azure Designing and Implementing Cloud Data Platform Solutions (70-473)', 'Azure Data Factory\r\nAzure Data Lake\r\nSQL\r\nNoSQL\r\nBig Data', NULL, NULL, NULL, NULL, 0, NULL, 'EAD-GC,EAD-H4,EAD-L2,Green Card,H1 Visa,TN Visa,US Citizen', NULL, NULL, NULL, 'Azure Data Factory, Azure Data Lake, SQL NoSQL, Big Data', 0, NULL, NULL, 'Hourly', 'public', NULL, 78, NULL, '2019-09-26 12:19:10', 78),
