acks, etc.).\r\n•         Experience with usability testing tools and processes\r\n•         You’re comfortable working in an open and collaborative environment with co-workers and customer stakeholders', 'UX design\r\nUser Research\r\nOil and Gas industry', NULL, NULL, NULL, NULL, 0, NULL, 'EAD-GC,EAD-H4,EAD-L2,Green Card,H1 Visa,TN Visa,US Citizen', NULL, NULL, NULL, 'UX design,UX designUser Research,Oil and Gas industry', 0, NULL, NULL, 'Hourly', 'public', NULL, 84, NULL, '2019-09-27 09:12:22', 84),
