(161, NULL, '48193', 94, '93', 'java Developer', 2, '2', 'Itscient LLC', '15k', '20k', 'Annum', '2019-09-28', 'Published', 'no', 'United States', '2019-10-04', NULL, 'BA', '8', '8', '8', 'Maryland', 'NY', 'Contract', '6', 'Month', '2', 'Job Details:\r\nMust Have Skills\r\n- Design of Java Springboot based Microservices\r\n- Hands on development of Springboot based Microservices\r\n- Experience of Cloud Native Design and Development\r\n\r\nNice to have skills\r\n- Exposure to Apigee\r\n- Kakfa\r\n\r\nDetailed Job Description\r\n- Project is a large Transformation programme based on API and Microservices for a US based Healthecare client.\r\n\r\nProcess Workflow Steps:\r\na.      Request distributed for sourcing\r\nb.      Supplier submits candidate profile(s)\r\nc.      MSP reviews and dispositions (MSP Qualify) candidate profiles for manager review\r\nd.      Candidate is evaluated and selected by manager (PM Qualified)\r\ne.      MSP Team releases offer for supplier Offer Acceptance/Approval; Supplier initiates BGC\r\nf.      Once accepted & approved by the supplier the workflow goes to Worker Download then PO ID Upload\r\ng.      Once the PO is uploaded, the workflow circles back to the MSP Team for Onboarding\r\nh.      When the supplier has confirmed that the BGC is complete and ajudicated green, the MSP Team will onboard the candidate to complete the workflow in Beeline\r\ni.      Every 6 months, you will receive a survey form our team requesting input on your experience.', 'Springboot,Microservices,Cloud Native', 'Kakfa, Apigee', NULL, NULL, NULL, 0, NULL, 'EAD-GC,EAD-H4,EAD-L2,EAD-OPT,Green Card,H1 Visa,US Citizen', NULL, NULL, NULL, 'Springboot,Microservices,Cloud Native', 0, NULL, NULL, 'Annum', 'public', NULL, 94, NULL, '2019-09-28 09:08:38', 94),
