roducts (MVP)\r\n\r\n•                        History evolving Product Roadmap from MVP to the ultimate product vision\r\n\r\n•                        Proven track record of meeting commitments\r\n\r\n•                        Grasp of the business model for a product and using it to inform the product strategy and roadmap\r\n\r\n•                        Business drivers\r\n\r\n•                        Opportunities and Threats\r\n\r\n\r\n•                        Cost Model.', 'Product Owner', 'Scrum', NULL, NULL, NULL, 0, NULL, 'US Citizen', NULL, NULL, NULL, 'Product owner,LMS,E learning', 0, NULL, NULL, 'Annum', 'public', NULL, 104, NULL, '2019-09-28 09:12:45', 104),
