(249, '7', 'Zen_pho-13', 76, '75', 'Oracle Apps DBA', 2, '4', 'zensar', '$65', '$70', 'Hourly', '2019-10-09', 'Published', 'no', 'United States', '2019-10-15', NULL, 'B.Tech', '6', '6', '6', 'Seattle', 'Washington', 'Contract', '6', '6', '2', 'Hello ,\r\n \r\n\r\nHope you are doing good.\r\n\r\n \r\n\r\nPlease go through this urgent requirement and let me know your interest ASAP.\r\n\r\n \r\n\r\n \r\n\r\nRole: Oracle Apps DBA\r\n\r\nLocation: seattle, WA\r\n\r\nContract: 6 Months\r\n\r\n \r\n\r\nLinkedin Id and Passport No.is mandatory.\r\n\r\n \r\n\r\nResponsibilities\r\nPosition duties and responsibilities include, but are not limited to:\r\nProvide advanced technical expertise in installation, configuration, and administration of Oracle databases in clustered environment on IBM-AIX, HP-UX, and Sun Solaris platforms.\r\nProvide hands-on administration of Real Application Cluster (RAC), Backup and Recovery, Oracle Dataguard, Golden Gate, OEM, and other advance database features and tools.\r\nPerform data administration using database commands and utilities including exp/imp, expdp/impdp, SQL Loader and ensure data security by using masking, redaction, TDE and similar tools and techniques.\r\nAct as Subject Matter Expert (SME) for database performance tuning and SQL tuning to deliver sub-seconds response time.\r\nApply hands-on expertise and advanced skills while supporting mission critical databases with the goal of resolution time and restoration of services under 90 minutes and identifying the root cause.\r\nReview code with emphasis on logical and physical data modeling and ensuring deployment in production and non-production environments is done with minimum defect density.\r\n\r\nMinimum Qualifications\r\nSkill requirements:\r\n(1) Installing, configuring, upgrading, monitoring, capacity planning, supporting, and automating Oracle databases in RAC environment with a high volume of transactions per day in IBM-AIX, HP-UX, and Sun Solaris platforms while ensuring that databases are SOX.\r\n (2) Designing, deploying, administering, and supporting RAC, Backup, and Recovery using RMAN, SRDF, Clone, Snaps and BCVs, Dataguard database and OS tools and leverage for DC migration, Golden Gate for Active-Active setup and Big Data replication, and OEM and its reporting to ensure ongoing availability of mission critical applications.\r\n(3) Conducting bulk data migration using database utilities including exp/imp, expdp/impdp, SQL loader, transportable table space, and OS based tools including SRDF to minimize outage for data migration while ensuring data security by applying advance TDE, masking, and redaction features.\r\n(4) Conducting performance tuning on OLTP (On-line Transaction Processing) databases larger than 30TB to deliver sub-second response time while applying OS tuning, SQL profiles, and baseline and optimizing Access Paths and Joins tools and techniques.\r\n(5) Performing logical and physical data modeling for code review and code deployment in production and non-production environment with minimum defect density', 'Oracle', 'oracle', NULL, NULL, NULL, 0, NULL, 'Green Card,US Citizen', NULL, NULL, NULL, 'oracle', 0, NULL, '$65', '$70', 'public', NULL, 76, NULL, '2019-10-09 17:00:04', 76),
